import React from 'react';
import { Nav } from 'react-bootstrap';
import NavbarBrand from 'react-bootstrap/esm/NavbarBrand';
import Container from 'react-bootstrap/esm/Container';
import './Navbar.css';
import Toggle from '../Toggle/Toggle.jsx';
import '../AboutMe/AboutMe';
import NavLink from 'react-bootstrap/esm/NavLink';
import AboutMe from '../AboutMe/AboutMe';
import NavbarContainer from 'react-bootstrap/esm/NavbarContainer';

const Navbar = () => {
  return (
    <Nav bg='light' expand='lg'>
      <Container>
        <NavbarContainer className='n-left'>
          <NavbarBrand className='n-name'>React-cv</NavbarBrand>
          <Toggle />
        </NavbarContainer>
        <Container className='n-right'>
          <Container className='n-list'>
            <ul style={{ listStyleType: 'none' }}>
              <NavLink to='about'>
                <li>Home</li>
              </NavLink>
              <NavLink to='about'>
                <li>About Me</li>
              </NavLink>
              <NavLink to='about'>
                <li>Expecience</li>
              </NavLink>
            </ul>
          </Container>
          <button className='button n-button'>Contact Me</button>
        </Container>
      </Container>
    </Nav>
  );
};

export default Navbar;
